import Calendar from 'react-calendar'
import { useState } from 'react';

const CalendarDisplay = () => {
    const [date, setDate] = useState(new Date());

    const onChange = date => {
      setDate(date);
    };


    return (
      <div>
          <h1>Calendar View</h1>
        <Calendar
          onChange={onChange}
          value={date}
        />
        <h3>{date.toString()}</h3>
      </div>
    );
}
 
export default CalendarDisplay;
